import styled from 'styled-components';

const TimerStyle = styled.div`
  display: flex;
  background-image: url('clock.gif');
  background-size: cover;
  background-repeat: no-repeat;
  width: 3rem;
  height: 3rem;
  justify-content: center;
  align-items: center;
`;

export default TimerStyle;
